import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Layout from './components/Layout'
import NavigationBar from './components/NavigationBar'
import Jumbotron from './components/Jumbotron'
import HomePage from './components/pages/HomePage'
import ProjectsPage from './components/pages/ProjectsPage'
import NoMatchPage from './components/pages/NoMatchPage'
import ExperiencesPage from './components/pages/ExperiencesPage'

import LoaderComponent from './components/LoaderComponent'
import Header from './components/Header'
import About from './components/About'
import Resume from './components/Resume'
import Projects from './components/Projects'
import Footer from './components/Footer'
import Social from './components/Social'

/*
// We use React.Fragment to have multiple page components side by side (NavigationBar, Jumbotron, Router Layout)
function App() {

  return (
    <React.Fragment>
      <Jumbotron title={"ALLISON WU"} />
      <NavigationBar />
      <Layout>
        <Router>
          <Switch>
            <Route exact path="/" component={HomePage} />
            <Route exact path="/projects" component={ProjectsPage} />
            <Route exact path="/experiences" component={ExperiencesPage} />
            <Route component={NoMatchPage} />
          </Switch>
        </Router>
      </Layout>
    </React.Fragment>
  );
}

export default App;
*/

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      resumeData: {
        main: { name: "Allison Wu", namecapped: "ALLISON WU", bio: "I'm a sophomore Computer Science major at the University of Florida, I like to build things, listen to music, and play with animals! I'm currently pursuing a Summer 2020 internship, and am hoping to gain knowledge in User Experience, Data Science, and overall Software Development.", phone: "(916) 952-3707", email: "allisonwu2000@gmail.com", resume: "https://drive.google.com/file/d/18D5CBLWpP9oDDFJ8k5-bPiPvS6HbVLSZ/view?usp=sharing" },
        resume: {
          skillmessage: "Proficient Technical Skills. I am currently seeking to learn more about User Experience, Reinforced Machine Learning.",
          education: [
            { imgname: "uflogo", school: "The University of Florida, College of Engineering", degree: "Bachelor of Computer Science", graduated: "Expected Graduation: May 2022", description: "Pursuing a minor in statistics.", coursework: ["Discrete Math", "Programming in Java", "Programming in C++", "Data Structures & Algorithms (Spring 2020)", "Introduction to Computer Organization (Spring 2020)"] }
          ],
          work: [
            { imgname: "intel-logo", company: "Intel", title: "Software Developer Intern", years: "May 2019 - Present", description: "Machine Learning, Web Development", skills: ["Python", "JavaScript", "HTML/CSS", "Git", "SQL", "Full Stack Web Development", "Multi-class text classification", "Unsupervised & Supervised Machine Learning"] },
            { imgname: "vector-logo", company: "Vector Solutions", title: "Data Management Intern", years: "April 2018 - May 2018", description: "Data wrangling and merging", skills: ["Excel", "SQL", "Salesforce Admin"] }],
          involvement: [{ imgname: "swamphacks-logo", name: "SwampHacks", title: "Logistics Coordinator - Events", years: "September 2019 - Present", description: "Events activities responsibilities" },
          { imgname: "magician-logo", name: "Magician", title: "Project Lead, Recruiter, UI programmer", years: "August 2018 - Present", description: "Unity (C#) game development" },
          { imgname: "swe-logo", name: "Society of Women Engineers", title: "Member", years: "August 2019 - Present", description: "About SWE...." },
          { imgname: "ufkb-logo", name: "Kickboxing", title: "Member", years: "September 2018 - Present", description: "Proud member of UFKB!" },
          ],
        },
        projects: [{ image: "image", title: "title", url: "url", category: "" }],
        social: [{ imgname: "linkedinlogo", name: "linkedin", url: "https://linkedin.com/in/allisonwu2000/" },
        { imgname: "maillogo", name: "email", url: "mailto:allisonwu2000@gmail.com" },
        { imgname: "githublogo", name: "github", url: "https://github.com/AllieWu" },
        ]
      }
    };
  }

  render() {
    const { resumeData } = this.state

    return (
      <div className="App">
        <LoaderComponent />
        <Header data={resumeData.main} />
        <Social data={resumeData.social} />
        <About data={resumeData.main} />
        <Resume data={resumeData.resume} />
        <Projects data={resumeData.projects} />
        <Footer />

      </div>
    );
  }
}

export default App;
